import React, { useState } from "react";
import { Link, NavLink, useNavigate } from "react-router-dom";
import logo from "../logo.webp"; // Adjust the path as necessary

const Nav = () => {
  const navigate = useNavigate();
  const [isLoggedin, setIsLoggedin] = useState(true); // Example state
  const [dropdownOpen, setDropdownOpen] = useState(false); // State for dropdown
  const username = "John Doe"; // Placeholder for username

  const logout = () => {
    localStorage.removeItem("token-info");
    setIsLoggedin(false);
    navigate("/"); // Redirect after logout
  };

  return (
    <nav className="bg-gray-800">
      <div className="max-w-7xl mx-auto px-6 lg:px-8">
        <div className="flex items-center h-16">
          {/* Logo Section */}
          <Link to="/" className="flex items-center">
            <img
              src={logo} // Image path
              alt="Logo"
              className="h-31 w-17 mr-3"
            />
          </Link>

          {/* Navigation Links */}
          <div className="flex space-x-4 mx-8 items-center justify-center">
            <NavLink
              to="/Home2"
              style={({ isActive }) => ({
                backgroundColor: isActive ? "white" : "#7D6EA9",
                color: isActive ? "#7D6EA9" : "white",
              })}
              className="text-purple-300 hover:bg-gray-700 hover:text-white px-3 py-2 rounded-md text-sm font-large"
            >
              Home
            </NavLink>
            <NavLink
              to="/Categories" // Corrected typos here
              style={({ isActive }) => ({
                backgroundColor: isActive ? "white" : "#7D6EA9",
                color: isActive ? "#7D6EA9" : "white",
              })}
              className="text-gray-300 hover:bg-gray-700 hover:text-white px-3 py-2 rounded-md text-sm font-medium"
            >
              Category
            </NavLink>
            <NavLink
              to="/AboutUs"
              style={({ isActive }) => ({
                backgroundColor: isActive ? "white" : "#7D6EA9",
                color: isActive ? "#7D6EA9" : "white",
              })}
              className="text-gray-300 hover:bg-gray-700 hover:text-white px-3 py-2 rounded-md text-sm font-medium"
            >
              About Us
            </NavLink>
          </div>

          {/* User Icon and Dropdown */}
          <div className="relative flex items-center ml-auto text-white">
            <i
              className="fas fa-user-circle mr-2 cursor-pointer"
              onClick={() => setDropdownOpen(!dropdownOpen)}
            />
            <span>{username}</span>

            {dropdownOpen && (
              <div className="absolute right-0 mt-2 w-48 bg-gray-900 text-white rounded-md shadow-lg z-10">
                <div className="py-2">
                  <button
                    onClick={logout}
                    className="block px-4 py-2 text-sm hover:bg-gray-700 w-full text-left"
                  >
                    Logout
                  </button>
                </div>
              </div>
            )}
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Nav;
